import React from 'react';
import styled from 'styled-components';

const Container = styled.div``;

const Items = styled.div``;

const A = styled.a`
  :active :visited :hover :link {
    color: #ffffff;
  }
`;

const ChildItemCatalog = ({ items }) => {
  const item = items.map((itemMap) => (
    <Items key={Math.random()}>
      <A href="/#">{itemMap}</A>
    </Items>
  ));

  return <Container>{item}</Container>;
};

export default ChildItemCatalog;
